EntityFilter.summary:
			List of ListID strings to query for


				
					Example:
					qbRq.AccountFilter = new() { ListID = new() { "{ListID from your Quickbooks file}" } };

			List of FullName string to query for


				
					Example:
					qbRq.AccountFilter = new() { FullName = new() { "SampleAccountName" } };

			List of ListID strings to query for


				
					Example:
					qbRq.AccountFilter = new() { ListIDWithChildren = new() { "{ListID from your Quickbooks file}" } };

			List of FullName string to query for


				
					Example:
					qbRq.AccountFilter = new() { FullNameWithChildren = new() { "SampleAccountName" } };

